import React from "react";
import logo from "../../images/logo.jpeg";

const Header = () => {
	let classes = styles();

	return (
		<React.Fragment>
			<img src={logo} />
			<span>Post Job</span>
			<span>Find Job</span>
			<span>Log In</span>
			<span>Sign Up</span>
		</React.Fragment>
	);
};

export default Header;
